window.bookSummaryJSON = "<p>Daniel's guide to early retirement:&nbsp;&nbsp;</p> <p></p> <ol> <li>Intercept illegal money transfer from mafia boss.&nbsp;</li> <li>Hide out in super-exclusive full-immersion virtual reality game until the heat is off.&nbsp;</li> <li>Roll a bard. Max out charisma. Live it up.&nbsp;&nbsp;</li> <li>Profit.&nbsp;&nbsp;</li> </ol> <p>With all the pesky planning out of the way, Daniel set out to realize his ultimate dream: gaining enough money to buy a tropical island and spend his days playing the violin and RPGs. What could possibly go wrong?&nbsp;&nbsp;</p> <p>Disclaimer: There shall be no harems in this series. Overpowered, perfect protagonists will not be tolerated, and excessive cursing will result in donations to the swear jar.&nbsp;&nbsp;&nbsp;</p> <p>The Soundbooth Theater team for this production:&nbsp;&nbsp;</p> <p></p> <ul> <li>Justin Thomas James - narration, music direction, editing, mastering&nbsp;</li> <li>Laurie Catherine Winkel - female characters&nbsp;</li> <li>Jeff Hays - Gillem Drizzlefog, Greck, and other supporting characters&nbsp;</li> <li>Dalton Lynne - proofing, editing</li> </ul>"; 
